/*App.js*/
import React, { Component } from "react";
import Entrance from "./pages/entrance";
import "./App.css";

import {
  BrowserRouter as Router,
  Route,
} from "react-router-dom";

class App extends Component {
  render() {
    return (
      <Router>

          <Route path="/entrance" component={Entrance} />

      </Router>
    );
  }
}

export default App;
